INSERT INTO `wp_9_posts` VALUES (1,1,'2025-07-25 01:06:31','2025-07-25 01:06:31','Welcome to <a href=\"https://technologyfoc.us/\">wordpress-multisite sites</a>. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2025-07-25 01:06:31','2025-07-25 01:06:31','',0,'http://sanzdesigncom.technologyfoc.us/?p=1',0,'post','',1),(2,1,'2025-07-25 01:06:31','2025-07-25 01:06:31','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://sanzdesigncom.technologyfoc.us/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','trash','closed','open','','sample-page__trashed','','','2025-07-25 01:47:43','2025-07-25 01:47:43','',0,'http://sanzdesigncom.technologyfoc.us/?page_id=2',0,'page','',0),(3,1,'2025-07-25 01:44:01','0000-00-00 00:00:00','','Auto Draft',''