nd I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://sanzdesigncom.technologyfoc.us/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2025-07-25 01:47:43','2025-07-25 01:47:43','',2,'https://sanzdesigncom.technologyfoc.us/?p=9',0,'revision','',0),(10,0,'2025-07-25 01:49:30','2025-07-25 01:49:30','<!-- wp:page-list /-->','Navigation','','publish','closed','closed','','navigation','','','2025-07-25 01:49:30','2025-07-25 01:49:30','',0,'https://sanzdesign.com/uncategorized/navigation/',0,'wp_navigation','',0),(11,1,'2025-07-26 21:13:34','2025-07-26 21:13:34','<!-- wp:paragraph -->\n<p>Test</p>\n<!-- /wp:paragraph -->','Test','','publish','closed','open','','test','','','2025-07-26 21:14:13','2025-07-26 21:14:13','',0,'https://sanzdesign.com/?p=11',0,'post','',0),(12,1,'2025-07-26 21:13:34','2025-07-26 21:13:34','<!-- wp:paragraph -->\n<p>Test</p>\n<!-- /wp:paragraph -->','Test','','inherit','closed','closed','','11-revision-v1','','','2025-07-26 21:13:34','2025-07-26 21:13:34','',11,'https://sanzdesign.com/?p=12',0,'revision','',0);
